import{d as b,v as t,o as d,c as f,b as v,t as r,f as e,bc as h,_ as s}from"./chunk-BtNdwCXR.js";const n={class:"serviceAgreement"},c=h('<div class="text_markedness" data-v-51b9748f><h2 data-v-51b9748f>特别提示</h2> 感谢您选择雀金裘。您在接受雀金裘安全服务前，除非您已充分阅读，并确认同意本协议所有条款，否则您将无权获得、部署、使用雀金裘提供的相关服务。当您完成“同意条款并注册”或开始以注册、信息提交、部署及使用等其他行为开始使用雀金裘相关服务，均视为您已阅读、充分理解本协议的约定，同意接受本协议的约束，包括雀金裘对本协议随时作出的更新修改、补充公告及其他方式的变更等。<br data-v-51b9748f> 如您对本协议有任何疑问或对本协议不能做出合理理解，您可通过平台或雀金裘官网【https://quejinqiu.com】联系我们进行咨询。<br data-v-51b9748f> 如涉及具体服务的服务内容、权利义务等内容的表述,参加具体服务页面或相关具体协议，以具体服务页面或相关具体协议为准，本协议条款前的标题或关键词系对项下条款的主旨表达之义，利于您对该条款的理解，但不影响或限制协议条款依据法律所作出的真实的含义或解释。<br data-v-51b9748f><h2 data-v-51b9748f>协议主体及范围</h2> 协议主体指本协议双方，即同意接受本协议全部条款及使用雀金裘服务的“您”和提供雀金裘服务的“雀金裘”。“您”在本协议项下亦可能被称呼为“用户”。本协议由双方共同缔结，对双方均具有法律约束力。请确保您是具备完全民事权利能力和完全民事行为能力的自然人,法人或其他组织，如您不具备上述要求，您将不能正常使用雀金裘服务。<br data-v-51b9748f> 根据国家法律法规变化、运营需要或为提升雀金裘服务体验为目的，雀金裘将在必要时对本协议作出相关公告、使用规则、风险提示、政策、规范等内容以及不时的修改更新，上述内容一经正式发布，构成本协议不可分割的组成部分，与本协议具有同等法律效力，共同适用于您使用雀金裘服务。如您在上述内容公布或更新修改后继续适用雀金裘服务，将视为您已同意上述内容，即本协议包括为本协议作出的相关公告、使用规则、风险提示、政策、规范等内容。<br data-v-51b9748f><h2 data-v-51b9748f>账号</h2> 1. 您必须是具备完全民事权利能力和完全民事行为能力的自然人,法人或其他组织，按照雀金裘的要求完成注册以获得雀金裘服务账号（以下简称“账号”）。<br data-v-51b9748f> 2. 您的账号信息应不违反国家相关法律法规，并保证填写提交的信息真实、合法、有效。如相关信息发生变更，您应及时完成更新。<br data-v-51b9748f> 3. 您的账号通常会成为您在使用雀金裘服务过程中的唯一身份标识，请妥善保管好您注册的账号和设置的密码，如发现账号异常，请立即通知雀金裘。<br data-v-51b9748f> 4. 请保证在使用雀金裘服务过程中，遵守国家法律法规及电信网络安全的相关政策性规范和用户使用规范。<br data-v-51b9748f> 5.您对您的账号拥有使用权，雀金裘对您的账号拥有所有权。<br data-v-51b9748f><h2 data-v-51b9748f>用户使用规范</h2> 用户在使用雀金裘提供的服务过程中，不得制作、复制、发布或传播违反法律法规禁止或侵犯第三方合法权益的信息，信息包括但不限于：<br data-v-51b9748f> 煽动抗拒、破坏宪法和法律、行政法规实施的；<br data-v-51b9748f> 煽动颠覆国家政权，危害国家安全，泄露国家秘密，破坏国家统一的；<br data-v-51b9748f> 煽动民族仇恨、民族歧视，破坏民族团结的，损害国家荣誉和利益的；<br data-v-51b9748f> 破坏国家宗教政策，宣扬邪教和封建迷信的；<br data-v-51b9748f> 散布谣言，扰乱社会秩序，破坏社会稳定的；<br data-v-51b9748f> 散布淫秽、色情、赌博、暴力、恐怖或者教唆犯罪的；<br data-v-51b9748f> 侮辱或者诽谤他人，侵害他人合法权益的；<br data-v-51b9748f> 煽动非法集会、结社、游行、示威、聚众扰乱社会秩序；<br data-v-51b9748f> 侵犯国家利益、社会公共利益及第三人利益的；<br data-v-51b9748f> 发布、传送、传播、储存侵害他人名誉权、肖像权、知识产权、商业秘密等合法权利的内容；<br data-v-51b9748f> 涉及他人隐私、个人信息或资料的； 其他违反宪法和法律、行政法规的。<br data-v-51b9748f> 用户对在接受服务过程中，所制作、复制、发布或传播的上述信息自行承当相应的违法或侵权法律后果。 雀金裘有义务为国家或第三方存储、保存和提交相应的违法或侵权信息证据。<br data-v-51b9748f> 用户在接受雀金裘服务时，必须遵守相关法律、行政法规及规范性政策，不得从事下列违法或不正当行为：<br data-v-51b9748f> 删除服务上一切关于著作权的信息；<br data-v-51b9748f> 对相关服务进行反向工程、反向汇编、反向编译，或者以其他方式尝试发现雀金裘的源代码；<br data-v-51b9748f> 修改、破坏雀金裘服务原状；<br data-v-51b9748f> 进行任何危害网络安全的行为，包括但不限于：使用未经许可的数据或进入未经许可的服务器/账户；未经允许进入公众网络或者他人操作系统并删除、修改、增加、复制存储信息；<br data-v-51b9748f> 未经许可企图探查、扫描、测试雀金裘服务系统或网络的弱点或其它实施破坏网络安全的行为；企图干涉、破坏系统或网站的正常运行，故意传播恶意程序或病毒以及其他破坏干扰正常网络信息服务的行为；伪造TCP/IP数据包名称或部分名称；<br data-v-51b9748f> 未经雀金裘书面同意，擅自实施包括但不限于下列行为：使用、出租、出借、复制、修改、链接、转载、汇编、发表、出版，建立镜像站点、借助雀金裘的服务发展与之有关的衍生产品、作品、服务、插件、外挂、兼容、互联等；<br data-v-51b9748f> 通过修改或伪造服务运行中的指令、数据、数据包，增加、删减、变动服务的功能或运行效果，或将用于上述用途的服务通过信息网络及其他方式向公众传播或者运营；<br data-v-51b9748f> 在未经雀金裘书面明确授权的前提下，出售、出租、出借、散布、转移或转授权服务或相关的链接或从使用服务或服务的条款中获利；<br data-v-51b9748f> 其他以任何不合法的方式、或为任何非法目的、或以任何与本协议不一致的方式使用雀金裘提供的服务；<br data-v-51b9748f> 其他法律法规禁止或未经雀金裘书面授权的行为。<br data-v-51b9748f> 用户若违反上述规定，雀金裘有权采取终止、完全或部分中止、限制用户使用雀金裘服务。如因用户上述行为，导致或产生第三方主张的任何索赔、要求或损失，由用户自行承担；由此造成雀金裘损失的，雀金裘有权追偿。<br data-v-51b9748f><h2 data-v-51b9748f>服务内容</h2> 1. 雀金裘服务是指通过雀金裘提供的各类服务，您可以通过雀金裘官网（quejinqiu.com）的具体服务页面获得相应服务内容。<br data-v-51b9748f> 2. 您在接受服务过程中，因网站遭受如DDoS攻击等不可抗力因素时，会严重占用雀金裘流量，并在攻击到达一定的程度时，雀金裘的服务会出现无法加载等异常现象。届时，雀金裘将会提供相关的付费定制防护服务来升级产品，如果用户不愿使用相关付费服务，雀金裘有权终止所有服务。<br data-v-51b9748f> 3. 您应知晓并同意，雀金裘可能会根据需要更新或调整雀金裘服务的内容，您也可以通过雀金裘官网【https://quejinqiu.com】了解最近的服务。<br data-v-51b9748f> 4. 您使用雀金裘提供的服务，您需对拟部署雀金裘服务的网站和APP享有所有权或合法的使用权，否则，雀金裘有权终止您的全部验证服务。如因此侵犯第三人合法权益的，由您承担全部法律责任。<br data-v-51b9748f><h2 data-v-51b9748f>服务说明</h2> 1. 您确认，您接受本协议并同意使用雀金裘服务系您真实意思表示，非因本协议之目的或其他任何非法目的或侵害第三人利益使用本协议项下雀金裘服务。否则，由您依照法律法规承担因此而导致的一切后果。<br data-v-51b9748f> 2. 雀金裘为互联网服务的提供方，在您使用服务过程中，您需具备相关软件运行或接受服务所需要的软硬件条件，以避免互联网过程中存在的某种使用风险。在现行法律允许范围内，雀金裘不对该等使用风险所遭受的直接或间接侵权损失承担赔偿责任。同时，您还必须承担使用服务所需要的网络、设备等费用。<br data-v-51b9748f><h2 data-v-51b9748f>信息保护</h2> 1. 雀金裘重视用户个人信息的保护，并采取合理措施保护用户的信息和数据。在您接收本协议项下的服务时，您需注册提交相关信息，雀金裘会按照公布的隐私政策收集、存储、使用和保护您的个人信息。<br data-v-51b9748f> 2. 雀金裘的服务不含有任何旨在破坏用户计算机数据和获取用户隐私信息的恶意代码。未经您的同意，雀金裘不会向任何第三方公开、披露您的个人信息，也不会与第三方进行共享，但法律法规另有规定的除外。<br data-v-51b9748f> 3. 您可以通过认真阅读《法律声明及隐私政策》，进一步的了解您个人信息的处理方式，帮助您更好的保护您的隐私。<br data-v-51b9748f><h2 data-v-51b9748f>知识产权</h2> 1. 雀金裘对其提供的服务享有完整的所有权、知识产权或得到充分授权。您可以为非商业目的在计算机或其他掌上终端上安装、使用、显示、运行或接受雀金裘服务。在您的使用服务过程中，不因本协议发生任何雀金裘服务的知识产权权利转移。<br data-v-51b9748f> 2. 因本协议向您提供的服务中所有信息内容的所有权及知识产权权利人为雀金裘。该信息内容包括但不限于程序代码、图形、图片、账号、图标、文字、界面设计、数据资料等，除按照法律法规规定由相关权利人享有权利的内容除外，但用户经许可自行提供的图形、鱼片、图标等资料除外。<br data-v-51b9748f> 3. 用户不得为商业运营目的安装、使用、运行雀金裘提供的免费版服务，不可以对使用过程中释放到任何终端内存中的数据及本软件运行过程中客户端与服务器端的交互数据进行复制、更改、修改、挂接运行或创作任何衍生作品，形式包括但不限于使用插件、外挂或非经授权的第三方工具/服务接入相关系统。<br data-v-51b9748f><h2 data-v-51b9748f>免责声明</h2> 1. 用户应在使用雀金裘产品及服务过程中，应遵守国家法律、法规及政策的规定，自行承担因违法信息、违法行为或其他侵权行为所产生的法律后果。<br data-v-51b9748f> 2. 雀金裘对所有用户在行为验证产品中上载的图片、图形或其他数字化作品的著作权归属不负事先审查义务。用户应当在明确自己没有侵害他人著作权的前提之下，在极意行为验证产品上载数字化作品，否则应当自行承担有关法律责任。<br data-v-51b9748f> 3. 鉴于本协议项下的产品和服务系基于互联网服务完成，网络服务包括但不限于网络的稳定性问题、恶意的网络攻击行为、运营商服务无法控制等因素，雀金裘可能变更、中断、中止或终止雀金裘行为验证服务。如发生该等情形，雀金裘免于承担责任，但尽可能的及时通过网页公告、系统通知、短信提醒等其他合理方式告知您。<br data-v-51b9748f> 4. 雀金裘提供的服务中不带任何病毒或恶意代码、程序，您对自行部署相关服务代码的行为负责。如因您拟部署的网站/APP的设备、部署环境或您的部署行为原因导致的相应风险，由您自行承担，雀金裘对该等事项不承担任何责任。<br data-v-51b9748f><h2 data-v-51b9748f>保密</h2> 本协议任何一方对从另一方获得的财务状况、知识产权、商业模式、客户信息、商业秘密等事项或资料均负有保密义务；除对履行本协议而必须知道上述保密事项或资料的人员外，不得向任何人或实体透露保密事项或资料。<br data-v-51b9748f><h2 data-v-51b9748f>违约责任</h2> 1. 用户违反本协议任一条款约定，均视为违约。雀金裘有权选择采取终止、完全或部分中止、限制用户使用雀金裘服务。<br data-v-51b9748f> 2. 用户理解并同意，因用户违反本协议或相关服务条款的规定，导致或产生第三方主张的任何索赔、要求或损失赔偿或行政处罚等，由用户独立承担责任。由此导致雀金裘遭受损失的，用户应当予以赔偿。<br data-v-51b9748f> 3. 雀金裘拥有本协议项下服务的相关知识产权，该权利受《中华人民共和国著作权法》、《计算机软件保护条例》等中国法律、法规及相关国际公约的保护，任何未经授权而擅自修改、复制、发行、出租、传播、翻译、反向编译或反向工程本软件程序的全部或部分，均属于侵权行为，雀金裘保留依法追究其法律责任的权利。<br data-v-51b9748f><h2 data-v-51b9748f>协议修改</h2> 1. 雀金裘有权随时修订本协议的任何条款，一旦本协议的内容发生变动，雀金裘将会在官网上公布修订后的协议内容。同时，雀金裘也可选择其他合理方式（比如系统通知、公告等）向用户通知修订内容。<br data-v-51b9748f> 2. 用户不同意雀金裘对本协议的修订内容，应自修改事项确定生效之日起停止注册、部署、使用雀金裘服务的行为。用户继续接受雀金裘服务的，则视为用户同意对本协议相关条款所做的修订。<br data-v-51b9748f><h2 data-v-51b9748f>通知送达</h2> 雀金裘如提示某项服务收费或发布使用规则或风险告知或协议修订或系统升级等相关事项，将在用户使用的网页界面或服务平台或软件操作界面发布有关事项的公告，自公告发布之日起，各类通知、修订事项生效。届时，用户在选择接受服务时，视为已通知送达用户，雀金裘无需另行通知。<br data-v-51b9748f><h2 data-v-51b9748f>法律适用及管辖</h2> 本协议的成立、生效、履行、修订、补充、解释及纠纷解决，均适用中华人民共和国大陆地区法律，争议管辖地为本协议签订地有管辖权的人民法院。<br data-v-51b9748f><h2 data-v-51b9748f>其他约定</h2> 1. 雀金裘有可能针对本协议某项服务添加相关特别约定或服务协议。届时，用户接受该项服务的前提为同意该项服务所附带的所有规范性文件，包括但不限于本服务使用协议及专项服务协议等。<br data-v-51b9748f> 2. 本协议构成双方对本协议之约定事项及其他有关事宜的完整协议，除本协议规定之外，未赋予本协议各方其他权利。<br data-v-51b9748f> 3. 如本协议中的任何条款无论因何种原因完全或部分无效或不具有约束力，本协议的其余条款仍应有效，对双方具有约束力。<br data-v-51b9748f><br data-v-51b9748f> 雀金裘 </div>',1),o=b({__name:"index",setup(i){const{t:a}=t.useI18n();return(_,u)=>(d(),f("div",n,[v("h1",null,"雀金裘用户"+r(e(a)("menu.serviceAgreement")),1),c]))}}),p=s(o,[["__scopeId","data-v-51b9748f"]]);export{p as default};
